import React from "react";
import styled from "styled-components";

const Container = styled.div``;

const SerchTop = styled.div`
  display: flex;
`;
const SerchText = styled.input`
  outline: none;
  border: none;
`;
const Buttons = styled.div``;

const Issue = () => {
  return (
    <Container>
      <SerchTop>
        <h5>Issue</h5>
        <SerchText placeholder="issue名で検索"></SerchText>
        <Buttons>
          <button>New</button>
          <button>Dlete</button>
        </Buttons>
      </SerchTop>
    </Container>
  );
};

export default Issue;
